(2, '2017-04-18', 'nbaldeniq@mozilla.org              ', 'Merops nubicus', '4', '/assets/img/hotels/Manila-Marriott.jpg', 19310, 15243795, 'The Loft 5 Franschhoek is situated a mere 2-minute walk from the village centre. The luxury loft apartment is decorated on a modern', '76 Blaine Terrace', 'North Carolina', 'Durham', '5184', 'United States', 36.0512, -78.8577, 1, 13, '4', 84, 4),
