(23, 'fsauratp1@elpais.com', 3, 'Great location, really pleasant and clean rooms, but the thing that makes this such a good place to stay are the staff.', 3),
(24, 'gbourdicep5@bizjournals.com', 17, ' All of the people are incredibly helpful and generous with their time and advice.', 4),
(25, 'cacump8@slideshare.net', 18, 'We travelled with two six year olds and lots of luggage and despite the stairs up to the elevator this was one of the nicest places we stayed in the four weeks we were in Europe.', 5),
(26, 'arudeforthp9@sitemeter.com', 19, 'Thanks for making our visit to Florence that much better. Kudos to BIGFEET, MWAAH!', 5),
(27, 'pebbinpa@shutterfly.com', 20, 'We stayed here ten nights and loved our suite, the excellent breakfast, good in room coffee, bars and restaurants downstairs. ', 2),
(28, 'dandrellipd@alexa.com', 20, ' Super close to museums. Amazing restaurants and shopping all around. But, the best part is the service at this hotel!! BIGFEET is so lovely and accommodating. ', 3),
(29, 'mmallabonepe@prnewswire.com', 20, 'The location is very central. An easy 10 min walk (max) to the train or bus. ', 4),
(30, 'kandrewarthapf@elpais.com', 18, 'They offer a most wonderful breakfast. Our room was very European and had a huge bathtub. ', 5),
(31, 'sphythonpm@icio.us', 17, 'the rooms were nice with each being unique. The staff was very helpful and accomodating. A nice breakfast buffet.', 4),
(33, 'oabramowitzpn@wired.com', 14, 'The only drawback being the climb up a number of steps from the street level to the hotel reception because the elevator was extremely small and you need to wait when there is any crowd whatsoever', 4),
(34, 'cgotterps@ucoz.com', 11, 'The hotel is very nice, clean, and confortable, the staff very friendly and helpful, the rooms are spacious. Across the street from the main hotel.\nThanks for this lovely experience I\'ll be back soon.', 3),
(35, 'csoppettpx@github.com', 9, 'Small breakfast room that was constantly refreshed. I dropped a star because the access is not good for anyone with any mobility problems.', 2),
(36, 'kgourleypy@cdbaby.com', 8, ' Great to go back to the hotel, freshen up then step out a couple of yards and find good food. This is a very friendly family run hotel and the welcome glass of prosecco was appreciated.', 3),
(37, 'mbartlettq0@discuz.net', 7, 'This is situated in the most amazing location. Very close to the Vecchio bridge and the Uffizi. Down a street with plenty of small trattorias and bars, but it was not noisy at all.', 4),
(38, 'ddandq1@usnews.com', 14, ' Great stay. Would definitely stay again. Enjoy!', 5),
(40, 'nmatusovq4@biglobe.ne.jp', 15, 'The owner and his staff were marvelous. Breakfast was very nice. The location of this hotel is fantastic.', 2),
(41, 'nstubbinq5@friendfeed.com', 7, 'Excellent hotel. Super old and historic, but very updated in terms of really nice rooms, nicely appointed bathrooms, great A/C, super clean. ', 3),
(42, 'tnorganq7@stumbleupon.com', 15, ' Location also is excellent. Very close to the Ponte Vecchio and the Duomo.', 4),
(43, 'whalsworthq8@hexun.com', 7, 'Room was comfortable and clean. Breakfast is excellent! Incredible croissants and some of the best coffee I enjoyed in Florence.', 5),
(44, 'rfransemaiq9@cisco.com', 16, 'Rick Steves suggested the hotel and it turned out to be very nice. Hotel staff is very friendly and they were able to book an additional night for us at the last minute. ', 1),
(45, 'zjizhakiqa@psu.edu', 6, 'The only thing I didn\'t like was the bed which was way too hard in my opinion.', 4),
(46, 'mashmoleqd@weebly.com', 16, 'The lift is probably the smallest I have seen, but it works and it is kind of cute. ', 4),
(47, 'asailqf@china.com.cn', 7, 'Mind that you have to drag your luggage up a few stairs before you find the lift. ', 3),
(48, 'ycurringtonqh@altervista.org', 19, 'The service was very good. ', 2),
(49, 'lcoslittqj@is.gd', 19, 'The room was not big but it was fine. The breakfast was nice. Even if it is central, it is still quiet.', 3),
(50, 'mbeiningql@yahoo.com', 17, 'The location is perfect. Not too far to walk from the train station and it is close to the river, and the major sights are all in walking distance. ', 4),
(51, 'tnassiqn@cyberchimps.com', 8, ' great location on a quiet street street in a city that is packed with tourists even into October. Still a good visit and a good hotel.', 5),
(52, 'jradnedgeqq@admin.ch', 15, ' The room was pretty spacious and was quite comfortable.', 5),
(53, 'fmaymanqr@latimes.com', 8, ' Overall, the stay was quite nice. The staff is super helpful. Breakfast was quite good. ', 2),
(54, 'rdifrancescoqs@biblegateway.com', 14, 'We booked this hotel late due to an itinerary change. It was one of the more reasonable properties available that had good reviews.', 3),
(55, 'asieneqt@w3.org', 6, 'We would happily return to this hotel in the future.', 4),
(56, 'cmccrumqv@myspace.com', 14, 'The staff were all very friendly and provided great recommendations on local restaurants and assisted with luggage.', 5),
(57, 'rmallionqw@nih.gov', 6, 'This hotel has a great location and very friendly staff. Our room was spacious and clean. It is an old building with some imperfections in paint', 5),
(58, 'acurrr0@biglobe.ne.jp', 11, 'Loved this hotel: very clean, convenient, friendly and very helpful reception, good breakfast. Very reasonably priced, quiet location.', 2),
(59, 'sgriolir1@stanford.edu', 6, ' We took advantage of the roof top terrace and enjoyed a glass of wine from a bottle they sell in the hotel lobby.', 3),
(60, 'bhindenburgr3@google.ca', 12, 'There are a handful of steps to get to the elevator with a nice wide open staircase. The breakfast food available was delicious with a lot of options.', 4),
(61, 'kjanasr4@liveinternet.ru', 10, 'You cannot beat the staff, everyone that worked there was amazing and always offer help and great tips for around town.', 5),
(62, 'dcarner5@gravatar.com', 11, 'Located on a quiet street around the corner from everything, feels like the right place to stay. The rooms are spacious and clean.', 1),
(63, 'fwilshinr6@addthis.com', 10, 'We highly recommend that you organise your trip with Bigfeet, you will never be disappointed.', 4),
(64, 'bdebanker7@telegraph.co.uk', 10, ' We had a delicious complimentary breakfast every morning served!!', 4),
(65, 'ttimbyra@blogspot.com', 11, ' The hotel lived up to everything that they told us...perfect location and an amazing and friendly staff', 3),
(66, 'frammrb@samsung.com', 13, 'Staff were excellent and very helpful and the breakfast was very good indeed, all in all a quirky and very interesting place to stay just 5 minutes from Ponte Vecchio.', 2),
(67, 'drochesterrc@360.cn', 13, 'The staffs were very helpful.The hotel provides u almost every facilities from good rooms to desert safari,jeep safari,camel safari and tent stay, I miss it already. @Bigfeet you should expect me some time soon.', 3),
